import { Typography } from '@mui/material'
import { Box } from '@mui/material'
import React from 'react'

const HeroBanner = () => {
  return (
    <Box sx={{
        mt:{lg:'212px',x5:'70px'},
        ml:{sm:'50px'}
    }}>
        <Typography color="darkblue" fontWeight="600" fontsize="26px">
        The Path to a Better You Starts Here  
        </Typography>
    </Box>
  )
}

export default HeroBanner
